import {Card} from 'antd';
const PostCard = ({ post }) => {
    return (
        <Card title={post.Title} extra={<a href="#">More</a>} style={{ width: 300 }}>
            <p>{post.content}</p>
        </Card>
    );
}

export default PostCard;
